                            <div className='form-buttons'>
                                <button type='submit'>Save</button>
                                <button
                                    type='button'
                                    className='cancel-button'
                                    onClick={() => {
                                        resetForm();
                                    }}
                                >
                                    Cancel
                                </button>
                                <button
                                    type='button'
                                    className='refresh-button'
                                    onClick={refreshPage}
                                >
