                                            </thead>
                                            <tbody>
                                                {tableData.data.flat().map((item, index) => (
                                                    <tr key={index}>
                                                        <td>{item.s_pkt_hdr}</td>
                                                        <td>{item.s_frmwr_ver}</td>
                                                        <td>{item.s_pkt_typ}</td>
                                                        <td>{item.s_pkt_status}</td>
                                                        <td>{item.s_imei_no}</td>
